#-1 for computer win
#+1 for player win
import copy
import random


def gameOver(piles):
    """
    It checks if the game is over or not.
    
    :param piles: an array of integers representing the number of stones in each pile
    :return: a boolean value.
    """
    n=len(piles)
    for i in range (n):
        if(piles[i]!=0):
            return False
    return True

def alphaBetaPuring(piles,isMax,move,alpha,beta):
    """
    It's a recursive function that takes in the current state of the game, the player who's turn it is,
    the move that was made, and the alpha and beta values. It returns the best possible move for the
    player who's turn it is
    
    :param piles: The current state of the game
    :param isMax: True if it's the computer's turn, False if it's the human's turn
    :param move: The player who's turn it is to move
    :param alpha: the best value that the maximizing player can guarantee so far
    :param beta: the best value that the maximizing player can guarantee given the current state
    :return: The best value for the current player.
    """
    if(gameOver(piles)):
        if(move=="Computer"):
            return 1
        else:
            return -1
    if (isMax):
        best = -1000
        for i in range(len(piles)):
            if(piles[i]!=0):
                for j in range(1,piles[i]+1):
                    piles[i]=piles[i]-j
                    best=max(best,alphaBetaPuring(piles,not isMax,"Computer",alpha,beta))
                    piles[i]=piles[i]+j
                    if(best>=beta):
                        return best
                    alpha=max(alpha,best)
        return best
    else:
        best = 1000
        for i in range(len(piles)):
            if(piles[i]!=0):
                for j in range(1,piles[i]+1):
                    piles[i]=piles[i]-j
                    best=min(best,alphaBetaPuring(piles,not isMax,"Human",alpha,beta))
                    piles[i]=piles[i]+j
                    if(best<=alpha):
                        return best
                    beta=min(beta,best)                    
        return best

def findBestMove(piles):
    """
    It iterates through all possible moves, and returns the move that maximizes the value of the game
    state
    
    :param piles: The current state of the game, in the form of a list of integers
    :return: The best move for the computer to make.
    """
    bestVal = -1000
    bestMove = (-1, -1)
    pile=copy.deepcopy(piles)
    for i in range(len(pile)):
        if(piles[i]!=0):
            for j in range(1,piles[i]+1):
                pile[i]=pile[i]-j
                moveVal=alphaBetaPuring(pile,False,"Human",float('-inf'),float('inf'))
                pile[i]=pile[i]+j
                if (moveVal > bestVal):
                    bestMove = (i, j)
                    bestVal = moveVal
    return bestMove

def display(piles):
    """
    It prints the piles of stones in a single line.
    
    :param piles: a list of integers representing the number of stones in each pile
    """
    for i in piles:
        print(i,end=" ")
    print()

def play(piles):
    """
    The function takes a list of piles as input and plays the game until one of the players wins
    
    :param piles: a list of integers representing the number of coins/stones in each pile
    """
    while True:
        print("Computer's turn")
        i,j = findBestMove(piles)
        print("Computer removes from pile number "+str(i)+".")
        print("Computer removes "+str(j)+" coins/stones.")
        piles[i]=piles[i]-j
        display(piles)
        if(gameOver(piles)):
            print("======================================================")
            print()
            print("=====================Computer Win=====================")
            print()
            print("======================================================")
            break
        i=int(input("Enter from which pile u have to remove:"))
        j=int(input("Enter the number of coins/stones to remove:"))
        piles[i]=piles[i]-j
        display(piles)
        if(gameOver(piles)):
            print("=================================================")
            print()
            print("=====================You Win=====================")
            print()
            print("=================================================")
            break

# Generating a random number of piles and then generating a random number of stones in each pile.
n=random.randint(1,5)
piles=[]
for i in range(n):
    j=random.randint(1,5)
    piles.append(j)
print("Number of piles in Box:",n)
display(piles)
play(piles)

